import React from 'react';
import './Main.css';
import { fadeIn } from 'react-animations';
import Radium, {StyleRoot} from 'radium';

export default (props) =>{

    const styles = {
        fadeIn: {
            animation: 'x 3s',
            animationName: Radium.keyframes(fadeIn, 'fadeIn')
        }
    }

    return(
        <div className="container">
            <StyleRoot>
            <div className="col-12 mt-5 text-center Kevin" style={styles.fadeIn}>
                <h1 id="main">Hey, I'm Kevin</h1>
                <p>
                    I am a Full-Stack web developer with experience working in Python/Django, MERN, and C#/Asp.net 
                </p>
            </div>
            </StyleRoot>
        </div>
    )
};
